import React from 'react';
import animalsImage from '../images/cat1.png';


export default function ContentPage() {
  // Dummy data for cards
  const cardsData = [
    { id: 1, image: 'image1.jpg', text: 'Card 1', buttonLabel: 'Button 1' },
    { id: 2, image: 'image2.jpg', text: 'Card 2', buttonLabel: 'Button 2' },
    { id: 3, image: 'image3.jpg', text: 'Card 3', buttonLabel: 'Button 3' },
    { id: 4, image: 'image4.jpg', text: 'Card 4', buttonLabel: 'Button 4' },
    // Add more cards as needed
  ];

  return (
    <div className="container mx-auto py-8">
      <div className="grid grid-cols-4 gap-8">
        {cardsData.map((card) => (
          <div key={card.id} className="bg-white p-4 rounded-lg shadow-md">
            <img src={card.image} alt={`Image ${card.id}`} className="w-full h-40 object-cover mb-4 rounded-lg" />
            <h3 className="text-lg font-semibold mb-2">{card.text}</h3>
            <button className="bg-blue-500 hover:bg-blue-600 text-white font-semibold py-2 px-4 rounded">{card.buttonLabel}</button>
          </div>
        ))}
      </div>
    </div>
  );
};
